window.bookSummaryJSON = "<p>A dead ship returns to the Deep Dark with a live crew. </p> <p>Captain Ishmael Wang finally gets the <i>Chernyakova</i> out of the yard and embarks on a voyage into the Toe-Holds where the Confederated Planets Joint Committee on Trade has no authority. Where the law is whatever you say it is as long as you can enforce it. </p> <p>Where he learns that some will do anything to hide their secrets and everybody has a secret. </p>"; 
